import React,{useState,useEffect} from "react";

function Demo1() {
  const [count, setCount] = useState(10);
  const [name, setName] = useState("");

  function kajal(){
    setCount(count+1);
  }

  const saveData ={
    name:name,
  }
  useEffect(()=>{
    console.log("useEffect");
    console.log(saveData);
  },[saveData]);


  return (
    <div>
      <div>
        <button onClick={kajal} className="bg-red-500 p-5 rounded-full text-center">
          Click me
        </button>
        {count}
      </div>
      <div>name</div>
      <input type="text" className="bg-blue-500" onChange={(e)=>setName(e.target.value)}></input>
      <div className="bg-green-500 text-lg font-monts">{name}</div>
    </div>
  );
}

export default Demo1;
